import React from 'react';
import './Home.css'; // Mengimpor file CSS
import Navbar from '../components/Navbar';
import Pokemon from '../components/Pokemon';

// Komponen halaman Home
function Home() {
  return (
    <div className="home">
        <Navbar/>
        <Pokemon/>
    </div>
  );
}

export default Home;
